// @mui material components
import Card from "@mui/material/Card";
import Grid from "@mui/material/Grid";
// Soft UI Dashboard PRO React components
import SuiBox from "components/SuiBox";
// import SuiTypography from "components/SuiTypography";
// Soft UI Dashboard PRO React example components
import DashboardLayout from "examples/LayoutContainers/DashboardLayout";
import DashboardNavbar from "examples/Navbars/DashboardNavbar";
import Footer from "examples/Footer";
import DataTable from "examples/Tables/DataTable";
import opportunity from "layouts/authentication/error/opportunity";
import ivancik from "assets/images/ivancik.jpg";
import BackgroundBlogCard from "examples/Cards/BlogCards/BackgroundBlogCard";

function Opportunity() {


    return (
        <DashboardLayout>
            <DashboardNavbar />
            <SuiBox my={3}>

                <SuiBox mb={3}>
                    <Grid container spacing={3} alignItems="center">
                        <Grid item xs={12} lg={12}>
                            {/* <SuiTypography variant="h4" fontWeight="medium">
                                ELSS Lock-in free Report
                            </SuiTypography>
                            <SuiBox mt={1} mb={2}>
                                <SuiTypography variant="body2" textColor="text">
                                    * This report shows the units invested in ELSS funds which are free from Lock-in period of 3 years, for each user and can now be switched into other suitable fund choices.
                                </SuiTypography>
                            </SuiBox> */}

                            <BackgroundBlogCard
                                image={ivancik}
                                title="ELSS Lock-in free Report"
                                description={
                                    <>
                                        This report shows the units invested in ELSS funds which are free from Lock-in period of 3 years, for each user and can now be switched into other suitable fund choices.
                                    </>
                                }
                                buttonText="read more"
                                action={{ type: "internal", route: "/dashboards/crm", label: "read more" }}
                            />
                        </Grid>
                    </Grid>
                </SuiBox>
            </SuiBox>

            <SuiBox p={1} >
                <Card id="change-password">
                    <SuiBox  >
                        <SuiTypography variant="h4" fontWeight="medium">
                            ELSS Lock-in free Report
                        </SuiTypography>
                        <DataTable table={opportunity} entriesPerPage={false} />
                    </SuiBox>
                </Card>
            </SuiBox>
            <Footer />
        </DashboardLayout>
    );
}

export default Opportunity;
